import React from "react";
import "./Hero.css"; // optional, but styles are mostly in App.css

function Hero() {
  return (
    <section className="hero" id="home">
      <div className="hero-content">
        <h1>We Build Modern Offices</h1>
        <p>Creative interior solutions tailored for productivity and style.</p>
        <button className="btn-primary">Get Free Quote</button>
        <button className="btn-secondary">View Projects</button>
      </div>
    </section>
  );
}

export default Hero;
